import React, {Component} from 'react';

class Cauhoi extends Component {

    toSpeak = (id) => {
        var msg = new SpeechSynthesisUtterance(id);
        window.speechSynthesis.speak(msg);
    }
    displayElement = () => {
        switch (this.props.code) {
            case "one":
                return (
                    <a onClick={this.toSpeak("one")}>
                        <img className="h1" src="/numberImage/one.JPG" alt="" style={{height: '100px'}}/>
                    </a>
                )
            case "six":
                return (
                    <a onClick={this.toSpeak("six")}>
                        <img className="h2" src="/numberImage/six.JPG" alt=""/>
                    </a>
                )
            case "five":
                return (
                    <a onClick={this.toSpeak("five")}>
                        <img className="h3" src="/numberImage/five.JPG" alt=""/>
                    </a>
                )
            case "two":
                return (
                    <a onClick={this.toSpeak("two")}>
                        <img className="h4" src="/numberImage/two.JPG" alt=""/>
                    </a>
                )
            case "three":
                return (
                    <a onClick={this.toSpeak("three")}>
                        <img className="h5" src="/numberImage/three.JPG" alt=""/>
                    </a>
                )
            case "nine":
                return (
                    <a onClick={this.toSpeak("nine")}>
                        <img className="h6" src="/numberImage/nine.JPG" alt=""/>
                    </a>
                )
            case "four":
                return (
                    <a onClick={this.toSpeak("four")}>
                        <img className="h7" src="/numberImage/four.JPG" alt=""/>
                    </a>
                )
            case "seven":
                return (
                    <a onClick={this.toSpeak("seven")}>
                        <img className="h8" src="/numberImage/seven.JPG" alt=""/>
                    </a>
                )
            default:
                return (
                    <a onClick={this.toSpeak("eight")}>
                        <img className="h9" src="/numberImage/eight.JPG" alt=""/>
                    </a>
                )
        }
    }

    render() {
        return (
            <div className="number">
                {this.displayElement()}
            </div>
        );
    }
}

export default Cauhoi;
